    width: 300px;
    border: solid 1px #000000;
    background-color: white;
    padding: 10px;
`
const Groupping = styled.span`
    display: flex;
    justify-content: flex-end
`
const Img = styled.img`
    width: 100%;
    max-width: 500px;
`

export default function Item() {
    return (
        <div>

            <Card>
                <Img src={img1} />
                <h3>World Map3</h3>
                <h5>Owner : David</h5>
                <Groupping>
                    <button>รายละเอียด</button>
                </Groupping>
            </Card>

        </div>
    )
}
